import {
  Box,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import React from "react";
const Artist = ({ artist }) => {
  return (
    <Card
      className="multipleArtistDisplay"
      // sx={{ maxWidth: 200, height: "400px", m: "auto" }}
    >
      <Typography gutterBottom variant="h5" component="div">
        {artist.name}
      </Typography>

      <CardMedia
        component="img"
        height="300"
        image={
          require(`../../../../../..//resources/artist/images/profile/${artist.profileImage}`)
            .default
        }
        alt="green iguana"
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {artist.orignalName}
        </Typography>
      </CardContent>
      <CardActions style={{ background: "black" }}>
        <Box
          sx={{
            display: "flex",
            justifyContent: "space-evenly",
            width: "100%",
            height: "5px",
          }}
        >
          {/* //add buttob to open single page */}
        </Box>
      </CardActions>
    </Card>
  );
};

export default Artist;
